import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { ToastContainer } from "react-toastify";
import axios from "axios"; // Import Axios
import { handleError, handleSuccess } from "../utils";
import { Button } from "react-bootstrap";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";

// import AddIcon from "@mui/icons-material/Add";
import Paper from "@mui/material/Paper";
import Dropdown from "react-bootstrap/Dropdown";
// import MoreVertIcon from "@mui/icons-material/MoreVert";
import Box from "@mui/material/Box";
function Login() {
  const navigate = useNavigate();
  const [isActive, setActive] = useState(false);
  const [listData, setListData] = useState([]);
  const handleNavigation = (path) => {
    navigate(path); // Navigate to the desired route
  };

  useEffect(() => {
    getaList();
  }, []);

  const getaList = async () => {
    axios
      //   .get(
      //     `${listJobtype}?searchTerm=${searchTerm}&createdBy=${sessionId}&page=1&items_per_page=${limit}`
      //   )
      .get(` http://localhost:8080/auth/list-role`)
      .then((res) => {
        console.log("resdata", res?.data?.data);
        setListData(res?.data?.data);
        // let total = res.data.data.totalDocs;
        // setpageCount(Math.ceil(total / limit));
        // setCount(total);
        // setLoading(false);
      })
      .catch((err) => {
        console.log(err);
        // setLoading(false);
      });
  };
  return (
    <Box>
      <Link to="/adduser" className="agency-add btn next-btn">
        AddUser{" "}
      </Link>
      <TableContainer component={Paper} id="document-table">
        <Table aria-label="caption table" className="all-round-borders">
          <TableHead>
            <TableRow>
              <TableCell className="tableborder table-head-cell">
                Sr. No.
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Name
              </TableCell>

              <TableCell className="tableborder table-head-cell" align="center">
                Status
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="center">
                Action
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {listData?.length > 0 ? (
              listData.map((item, index) => (
                <TableRow key={item._id || index}>
                  <TableCell className="text-start tableborder">
                    {index + 1}
                  </TableCell>
                  <TableCell align="left" className="tableborder">
                    {item.name}
                  </TableCell>

                  <TableCell
                    align="left"
                    className="tableborder status-cell-width"
                  >
                    {/* {item.isActive ? <Activepopover /> : <Inactivepopover />} */}
                  </TableCell>
                  <TableCell
                    align="center"
                    className="tableborder table-editcell"
                  >
                    <Box className="table-edit-del">
                      {/* <ActionLink
                        isAuthorized={isPathInRoutes(
                          "/super-admin/edit-job-titles"
                        )}
                        to="/super-admin/edit-job-titles"
                        state={item._id}
                        unauthorizedTitle="Unauthorized Access"
                        label="Edit"
                        icon={<EditIcon />}
                      /> */}
                      <Dropdown drop="start" autoClose="outside">
                        <Dropdown.Toggle
                          id="dropdown-autoclose-outside"
                          className="action-toggle-button"
                        >
                          {/* <MoreVertIcon
                            className="dot-icon"
                            onClick={toggleClass}
                          /> */}
                        </Dropdown.Toggle>
                        <Dropdown.Menu className="dropdown-menu">
                          <Dropdown.Item>
                            {/* <ActionLink
                              isAuthorized={isPathInRoutes(
                                "/super-admin/edit-job-titles"
                              )}
                              to="/super-admin/edit-job-titles"
                              state={item._id}
                              unauthorizedTitle="Unauthorized Access"
                              label="Edit"
                              icon={<EditIcon />}
                            /> */}
                          </Dropdown.Item>
                          <Dropdown.Item>
                            {/* <ActionButton
                              isAuthorized={isPathInRoutes(
                                "/super-admin/delete-job-titles"
                              )}
                              onClick={() => deleteCheck(item._id)}
                              unauthorizedTitle="Unauthorized Access"
                              label="Delete"
                              icon={<DeleteOutlineIcon />}
                            /> */}
                          </Dropdown.Item>
                        </Dropdown.Menu>
                      </Dropdown>
                    </Box>
                  </TableCell>
                </TableRow>
              ))
            ) : (
              <TableRow>
                <TableCell colSpan={5} align="center">
                  No data available.
                </TableCell>
              </TableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}

export default Login;
